    constructor(props){
        super(props);
        this.state = {};
    }

    componentDidMount(){
        const nodes = [];
        for(let i = 0; i < 15; i++){
            const currentRow = [];
            for(let j = 0; j < 50; j++){
                currentRow.push([]);
            }
            nodes.push(currentRow);
        }
    }

    render(){
        return(
            <div>
                Hello world
                <Node></Node>
            </div>
        )
    }
}
